fields.audience:
Doctoral students with a concentration in Biostatistics are prepared for conducting the following types of research in health or medicine:
The design of comprehensive investigations;
The novel employment of existing statistical methods to address meaningful scientific questions;
The development of new statistical methodologies with immediate application to studies of the cause or treatment of disease.

fields.highlights:
Our program's special strengths include:
its ensemble of courses, most of them created specifically for this program;
extensive direct involvement of Fellows and other finance professionals;
strong participation by permanent faculty in teaching and mentoring students;
great depth in relevant areas of applied mathematics; and
our location in New York City, a focal point of the financial world.

